const DepartureSearchBox =(searchChange)=>{
	return(
		<div className='container'>
            <div className='row'>
			<input 
				//className='fl w-100 pa3 ba b--green bg-lightest-blue tc'
				type='search' 
				placeholder='出発バス停' 
				onChange = {searchChange}
			/>
            </div>
		</div>
		);
}
export default DepartureSearchBox;
